import React from 'react';
import { View, Text, TouchableOpacity } from 'react-native';
import globalStyles from '../Utils/Stylesheet';

const Auctions = () => {
    return (
        <View style={globalStyles.container}>
            <View style={[globalStyles.row, globalStyles.center]}>
                <Text style={globalStyles.titleText}>Auktionen</Text>
            </View>
            <View style={[globalStyles.row, { marginVertical: 10 }]}>
                <View style={[globalStyles.row, globalStyles.borderBox, { flex: 3 }]}>
                    {["Allgemein", "Bieten", "Kaufaufträge", "Exponate", "Anforderungen"].map((button, index) => (
                        <TouchableOpacity key={index} style={globalStyles.button}>
                            <Text style={globalStyles.buttonText}>{button}</Text>
                        </TouchableOpacity>
                    ))}
                </View>
                <View style={[globalStyles.borderBox, { flex: 1, marginLeft: 10 }]}>
                    <Text style={[globalStyles.buttonText, globalStyles.center]}>Informationen</Text>
                </View>
            </View>
            <View style={[globalStyles.borderBox, { flex: 1, backgroundColor: 'rgb(253,241,219)' }]}></View>
        </View>
    );
};

export default Auctions;
